<script setup>
import { ref, onMounted, toRefs, watch, defineEmits } from 'vue'
import tool from '@/utils/tool';

const userSetting = tool.local.get("userSetting")

const selectedChipStyle = ref(1)

onMounted(() => {
  // selectedChipStyle.value = userSetting.chipStyle
})

const emit = defineEmits(['success'])

function selectedConfirm() {
  userSetting.chipStyle = selectedChipStyle.value
  try {
    tool.local.set("chipType", selectedChipStyle.value)
    tool.local.set("userSetting", userSetting)
    emit("success")
    visible.value = false
  } catch (error) { }
}
const visible = ref(false)
const open = (row) => {
  visible.value = true
}

defineExpose({ open })
</script>

